script: |
  super -f text -I q11019.spq | sort > q11019.out

inputs:
  - name: q11019.spq
    data: |
      SELECT * FROM tab1 (FORMAT parquet) WHERE NOT 19 BETWEEN ( 19 * - 25 ) AND col1 * + ( - col1 ) - col0;
  - name: tab1

outputs:
  - name: q11019.out
    data: |
      51	14	96
      85	5	59
      91	47	68
